import json

if __name__ == '__main__':
    tags = ['Found broken crypto schemes','Found broken hash functions','Used constant keys in code','Uses untrusted TrustManager','Used export grade public Key','Uses untrusted HostNameVerifier','Used HTTP Protocol','Used < 1000 iteration for PBE','Found constant salts in code','Found constant IV in code','Found predictable seeds in code','Does not manually verify the hostname','Untrused PRNG','Used Predictable KeyStore Password']
    detail_results = {}
    coarse_results = {}
    app_name = ''
    with open('./new_result.log','r') as f:
        for line in f.readlines():
            if line.startswith('Analyzing APK:'):
                if app_name:
                    detail_results[app_name]=detail_errors
                if line == 'Analyzing APK:':
                    break
                app_name = line.split(':')[1].strip()
                detail_errors = []
            if app_name and line.startswith('***Violated Rule'):
                rule = line[17:].split(':',1)
                rule_code = rule[0].strip()
                rule_disc = rule[1].strip()
                if rule_code == '7':
                    urls_str = rule_disc.split(':', 1)[1].strip()
                    urls_list = list(set(json.loads(urls_str)))
                    try:
                        urls_list.remove('http://localhost/')
                    except ValueError as e:
                        pass
                    if len(urls_list)==0:
                        continue
                detail_error = {rule_code:rule_disc}
                detail_errors.append(detail_error)
    print(detail_results)

    for app in detail_results.keys():
        errors = []
        for err in detail_results[app]:
            for i in range(0,len(tags)):
                if str(i+1) in err.keys():
                    errors.append(tags[i])
        coarse_results[app]=list(set(errors))
    print(coarse_results)

    statistics = {}
    for app in coarse_results.keys():
        for err in coarse_results[app]:
            if err in statistics.keys():
                statistics[err] = statistics[err]+1
            else:
                statistics[err]=1
    print(statistics)

    stats_per = {}
    for key in statistics.keys():
        stats_per[key]=statistics[key]/122
    print(stats_per)


